from django.shortcuts import render, redirect
from . models import Flames
from django.contrib import messages

relation_result = ""
quotes = ""
images = ""


# Create your views here.
def flames_home(request):

    return render(request, 'flamesapp/flames.html')


def result(request):
    global relation_result, quotes, images
    if request.method == 'POST':
        name1 = request.POST['name1'].lower()
        # print(name1.isalpha())
        name2 = request.POST['name2'].lower()
        # print(name2.isalpha())

        db_name1 = name1
        db_name2 = name2
        name1 = name1.replace(" ", "")
        name2 = name2.replace(" ", "")
        if name1.isalpha() and name2.isalpha():
            for name1_characters in name1:
                for name2_characters in name2:
                    if name1_characters == name2_characters:
                        name1 = name1.replace(name1_characters, "", 1)
                        name2 = name2.replace(name2_characters, "", 1)
                        break

            names_length = len(name1 + name2)

            # print(name1)
            # print(name2)
            # print(names_length)

            if names_length > 0:
                flames_list = ["Friend", "Lover", "Affectionate", "Marriage", "Enemy", "Sibling"]
                while len(flames_list) > 1:
                    count = names_length % len(flames_list)
                    # print(count)
                    remove_index = count - 1
                    # print(remove_index)
                    if remove_index >= 0:
                        left = flames_list[:remove_index]
                        right = flames_list[remove_index + 1:]
                        flames_list = right + left
                        # print(flames_list)
                    else:
                        flames_list = flames_list[:remove_index]
                        # print(flames_list)
                # print(flames_list[0])
                relation_result = flames_list[0]
                Flames.objects.create(name1=db_name1, name2=db_name2, result=relation_result)

                if relation_result == 'Friend':
                    images = "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTKJ-Ab6npYIYXzCOBQyCS1R0p9dDla4d021A&usqp=CAU"
                    quotes = "A real friend is one who walks in when the rest of the world walks out"
                elif relation_result == 'Lover':
                    images = "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTsyoJOQPzDjWAjJxY4VDm6Phh8bU52cXKQ9A&usqp=CAU"
                    quotes = "Sometimes the heart sees what is invisible to the eye"
                elif relation_result == 'Affectionate':
                    images = "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRhDftKv-OrMrfVxdDn29RaZ0f_KzH4tWB9Kg&usqp=CAU"
                    quotes = "There is no power greater than true affection"
                elif relation_result == "Marriage":
                    images = "data:image/jpeg;base64,"
                    quotes = "A successful marriage requires falling in love many times, always with the same person"
                elif relation_result == "Enemy":
                    images = "data:image/jpeg;base64,"
                    quotes = "Whenever you are confronted with your enemy, conquer him with love"
                else:
                    images = "data:image/jpeg;base64,"
                    quotes = "Siblings - The definition that comprises love, strife, competition and forever friends"

                return render(request, 'flamesapp/result.html',
                              {'relation_result': relation_result, 'quotes': quotes, 'images': images})
            else:
                # print("Enter different names")
                messages.info(request, "Enter different names")
                return redirect('/')
        else:
            messages.info(request, "Enter valid names")
            return redirect('/')